import { Link } from "react-router-dom";
import RoleNav from "./RoleNav";
import logo from "../images/travel_logo.png";
import logo1 from "../images/tour&travel_logo.png";

const Header = () => {
  return (
    <div>
      <nav className="navbar navbar-expand-lg custom-bg text-color">
        <div className="container-fluid text-color d-flex align-items-center">
          <img
            //src={logo}
            src={logo1}
            height="80"
            width="auto"
            className="d-inline-block align-top me-2"
            alt="TravelZen Logo"
            style={{ borderRadius: "10px", boxShadow: "0px 4px 8px rgba(0, 0, 0, 0.2)" }}
          />
          <Link to="/" className="navbar-brand fs-3 fw-bold text-color-second ms-2">
            <i>TravelZen</i>
          </Link>

          <button
            className="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarSupportedContent"
            aria-controls="navbarSupportedContent"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <ul className="navbar-nav ms-auto">
              <li className="nav-item">
                <Link to="/aboutus" className="nav-link text-color">About Us</Link>
              </li>
              <li className="nav-item">
                <Link to="/contactus" className="nav-link text-color">Contact Us</Link>
              </li>
              <RoleNav />
            </ul>
          </div>
        </div>
      </nav>
    </div>
  );
};

export default Header;
